import React from 'react';

function Dropbox({ label, icon, altText, bgColor = "bg-blue-500", textColor = "text-white", borderColor = "border-blue-500" }) {
  return (
    <button className={`flex gap-2 justify-center px-3 py-2 ${bgColor} ${textColor} ${borderColor} border rounded-xl`} aria-label={altText}>
      <span className="font-bold">{label}</span>
      <div className="shrink-0 my-auto w-4 aspect-square">
        {icon}
      </div>
    </button>
  );
}

export default Dropbox;
